/*
* Android Data Interface
* */
function getDataFromAndroid(){
    if (typeof AndroidInterface === "undefined") {
        console.warn(`AndroidInterface is not defined`)
        return null
    }
    try{
        const rawData = AndroidInterface.getData()
        return JSON.parse(rawData)
    }catch (error) {
        console.warn(`Broken JSON data received from Kotlin: ${error}`)
        return null
    }
}
function returnDataToAndroid(anyData){
    if (typeof AndroidInterface === "undefined") {
        console.warn(`AndroidInterface is not defined`)
        return
    }
    try{
        AndroidInterface.onResult(JSON.stringify(anyData))
    }catch (error){
        console.warn(`Error occurred while sending data to Android: ${error}`)
    }
}

/*
* Multi-party ECDSA processing
* */
async function keygen(addr, t, n) {
    let delay = Math.max(Math.random() % 500, 100)
    console.log('Creating new context for key generation')
    let context = await gg18_keygen_client_new_context(addr, t, n, delay)
    console.log('keygen round1')
    context = await gg18_keygen_client_round1(context, delay)
    console.log('keygen round2')
    context = await gg18_keygen_client_round2(context, delay)
    console.log('keygen round3')
    context = await gg18_keygen_client_round3(context, delay)
    console.log('keygen round4')
    context = await gg18_keygen_client_round4(context, delay)
    console.log('keygen round5')
    keygen_json = await gg18_keygen_client_round5(context, delay)
    console.log('generated data: ', keygen_json)
    return keygen_json
}

async function sign(addr, t, n, digest, key_store) {
    let delay = Math.max(Math.random() % 500, 100)
    console.log('Creating new context for signing')
    let context = await gg18_sign_client_new_context(
        addr,
        t,
        n,
        key_store,
        digest
    )
    console.log('sign round0')
    context = await gg18_sign_client_round0(context, delay)
    console.log('sign round1')
    context = await gg18_sign_client_round1(context, delay)
    console.log('sign round2')
    context = await gg18_sign_client_round2(context, delay)
    console.log('sign round3')
    context = await gg18_sign_client_round3(context, delay)
    console.log('sign round4')
    context = await gg18_sign_client_round4(context, delay)
    console.log('sign round5')
    context = await gg18_sign_client_round5(context, delay)
    console.log('sign round6')
    context = await gg18_sign_client_round6(context, delay)
    console.log('sign round7')
    context = await gg18_sign_client_round7(context, delay)
    console.log('sign round8')
    context = await gg18_sign_client_round8(context, delay)
    console.log('sign round9')
    sign_json = await gg18_sign_client_round9(context, delay)
    console.log('generated data: ', sign_json)
    return sign_json
}

async function main(dataFromAndroid){
    const action = dataFromAndroid.action
    const server = dataFromAndroid.server
    const threshold = dataFromAndroid.threshold
    const party = dataFromAndroid.party
    switch (action) {
        case "keygen":
            return await keygen(server, threshold, party)
        case "sign":{
            const digest = dataFromAndroid.digest
            const key_store = dataFromAndroid.key_store
            const parsed_key_store = JSON.parse(key_store)
            return await sign(server, threshold, party, digest, parsed_key_store)
        }
        default:
            console.warn(`Unsupported action: ${action}`)
            return null
    }
}


const dataFromAndroid = getDataFromAndroid()
if (dataFromAndroid) {
    main(dataFromAndroid).then((result) => {
        returnDataToAndroid(result)
    }).catch((error) => {
        returnDataToAndroid(error)
    });
}else{
    console.warn("No data is given")
}